void plot_pixel(int x, int y, short int line_color) {
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void plot_char(int x, int y, char * text){
	int offset =  (y << 7) + x;
	while(*(text)){
		*(char *)(0xC9000000 + offset) = *(text);
		++text;
		++offset;
	}
}




void swap(int* x, int* y) {
    *x = *x + *y;
    *y = *x - *y;
    *x = *x - *y;
}

void draw_line(int x0, int y0, int x1, int y1, short int color)
{
    int is_steep = FALSE;

    if(ABS(y1-y0) > ABS(x1-x0)) is_steep = TRUE;

    if (is_steep)
    {
        swap(&x0, &y0);
        swap(&x1, &y1);
    }

    if (x0 > x1)
    {
        swap(&x0, &x1);
        swap(&y0, &y1);
    }

    int dx = x1 - x0;
    int dy = y1 - y0;

    if (dy < 0)
    {
        dy *= -1;
    }

    int err = -(dx / 2);
    int y = y0;
    int y_step = -1;

    if (y0 < y1)
    {
        y_step = 1;
    }

    int x = x0;

    for (x = x0; x <= x1; ++x)
    {
        if (is_steep)
        {
            plot_pixel(y, x, color);
        }
        else
        {
            plot_pixel(x, y, color);
        }

        err += dy;

        if (err >= 0)
        {
            y += y_step;
            err -= dx;
        }
    }
}

void drawPlayer(int gravityGuyXPos, int gravityGuyYPos, int runningStep){
	int row =0, col =0;
		if (gravityGuyYPos > 90){
			for(col =0; col < 40; col++){
				for (row = 0; row < 60; row++){
					switch(runningStep){
						case 0:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running0[row][col]);
						break;
						case 1:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running1[row][col]);
						break;
						case 2:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running2[row][col]);
						break;
						case 3:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running3[row][col]);
						break;
						case 4:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running4[row][col]);
						break;
						case 5:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running5[row][col]);
						break;
						case 6:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running6[row][col]);
						break;	
					}
				}
			}
		}
		else{
			for(col =0; col < 40; col++){
				for (row = 0; row < 60; row++){
					switch(runningStep){
						case 0:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running0[59-row][col]);
						break;
						case 1:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running1[59-row][col]);
						break;
						case 2:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running2[59-row][col]);
						break;
						case 3:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running3[59-row][col]);
						break;
						case 4:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running4[59-row][col]);
						break;
						case 5:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running5[59-row][col]);
						break;
						case 6:
							plot_pixel(col + gravityGuyXPos , row + gravityGuyYPos, running6[59-row][col]);
						break;	
					}
				}
			}
		}
}

int checkIfOnPlatform (int x, int y, short int colorOfPlatforms){
	if (colorOfPlatforms == *(short int *)(pixel_buffer_start + ((y + BOX_LEN) << 10) + ((x + 5) << 1))||
	   colorOfPlatforms == *(short int *)(pixel_buffer_start + ((y + BOX_LEN) << 10) + ((x + hitBoxWidth + 5) << 1))){
		return TRUE;
	}
	else if (colorOfPlatforms == *(short int *)(pixel_buffer_start + ((y - 1) << 10) + ((x + 5) << 1))||
			colorOfPlatforms == *(short int *)(pixel_buffer_start + ((y - 1) << 10) + ((x + hitBoxWidth + 5) << 1))){
		return TRUE;	
	}
	else{
		return FALSE;
	}
}

