void print_scoreboard(int score){
	//make background black for scoreboard
	for(int i =0; i < 50; i++){
		for(int j=0; j<8; j++){
			plot_pixel(i+270,j,BLACK);
		}
	}
	//5 digit score
	if(score > 99999){
		score = 99999;
	}

	plot_char(69, 1, "Score:");
	char score_str[5];
	sprintf(score_str, "%d", score);
	if (score < 10){
	plot_char(75, 1, "0");
	plot_char(76, 1, "0");
	plot_char(77, 1, "0");
	plot_char(78, 1, "0");
	plot_char(79, 1, score_str);
	}
	else if (score < 100){
	plot_char(75, 1, "0");
	plot_char(76, 1, "0");
	plot_char(77, 1, "0");
	plot_char(78, 1, score_str);
	}
	else if (score < 1000){
	plot_char(75, 1, "0");
	plot_char(76, 1, "0");
	plot_char(77, 1, score_str);	
	}
	else if (score < 10000){
	plot_char(75, 1, "0");
	plot_char(76, 1, score_str);	
	}
	else{
	plot_char(75, 1, score_str);
	}
}

